import React, { useState } from 'react';

import './app.css'

import Main from './components/main';

const HeaderButtons = [
  {
    id:   1,
    name: 'About',
    pressed: false
  },
  {
    id:   2,
    name: 'Projects',
    pressed: false
  },
  {
    id:   3,
    name: 'Contact',
    pressed: false
  }
]

const App = () => {



  const [headerToggle, setHeaderToggle] = useState(false)
  const [headerButton, setHeaderButton] = useState("")

  const headerButtonToggled = (clicked, buttonName) => {
      setHeaderButton(buttonName)
      setHeaderToggle(clicked)
  }

  return (
    <div>
      <Main
        headerToggle={headerToggle}
        headerButtonToggled={headerButtonToggled}
        headerButton={headerButton}
      />
    </div>
  )
}

export default App;
